import React from 'react';
import './navbar.css';
import logo from '../logo.png';
import Container from '@mui/material/Container';
import Box from '@mui/material/Box';
import { AppBar, Button, Toolbar, Typography, Stack } from '@mui/material';

const NavBar = () => {
    return (
        <React.Fragment>
            <AppBar position='static' sx={{ top: 0, left: 0, right: 0, position: 'fixed', width: '100%' }}>
                <Toolbar sx={{ display: 'flex', flexDirection: 'row', alignItems: 'center', justifyContent: 'center' }} >

                    <Box component="img" sx={{ height: 480, width: 480, maxHeight: { xs: 480, md: 480 }, maxWidth: { xs: 480, md: 480 },}}
                        alt="logo"
                        src={logo}
                    />

                    <Stack direction='row' spacing={2}>
                        <Button color='inherit' href='/'>Home</Button>
                        <Button color='inherit' href='/QuemSomos'>Quem Somos</Button>
                        <Button color='inherit' href='/ContratacaoPlanos'>Planos</Button>
                        <Button color='inherit' href='/Contato'>Contato</Button>
                    </Stack>
                </Toolbar>
            </AppBar>
        </React.Fragment>
    );
}

export default NavBar;
